function ExpenseDate(props) {
  const month = props.date.getMonth().toLocaleString();
  const day = props.date.getDay();
  const year = props.date.getFullYear();

  return (
    <div>
      <p>{month}</p>
      <p>{day}</p>
      <p>{year}</p>
    </div>
  );
}

export default ExpenseDate;
